using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;
using System.Xml;

namespace BANNER
{
    class Program
    {
        static void Main(string[] args)
        {
            
            BannerAnnotate ba = new BannerAnnotate();
            ba.train_sol();
            //ba.train_sol_mturc();
            int passage_id = -1;
            XmlDocument doc = new XmlDocument();
            doc.Load("C:\\Users\\janas\\git\\banner1\\banner\\testing_data\\test_file.xml");
            
            foreach (XmlNode node in doc.DocumentElement.ChildNodes)
            {
                
                if(node.Name=="document")
                {
                    foreach (XmlNode chldnode in node.ChildNodes)
                    {
                        if(chldnode.Name=="id")
                        {
                            passage_id =Int32.Parse(chldnode.InnerText.ToString());
                        }
                        if (chldnode.Name == "passage")
                        {
                            int title_flag = 0;
                            int offset = 0;
                            foreach (XmlNode chldnode_chid in chldnode.ChildNodes)
                            {
                                if (chldnode_chid.InnerText == "title")
                                {
                                    title_flag = 1;
                                }
                                if(chldnode_chid.Name=="offset")
                                {
                                    offset = Int32.Parse(chldnode_chid.InnerText.ToString());
                                }
                                if (chldnode_chid.Name == "text")
                                {
                                    if (title_flag == 1)
                                    {
                                        string title = chldnode_chid.InnerText;
                                        
                                        int[] op=ba.find_annotate(title,passage_id,offset);
                                    }
                                    else
                                    {
                                        string abstracts = chldnode_chid.InnerText;
                                        int[] op = ba.find_annotate(abstracts,passage_id,offset);
                                    }

                                }
                            }
                        }
                    }
                    
                }
                
            }
        }


    }

